import org.jblas.DoubleMatrix

// ItemId 318:  Shawshank Redemption
val anItemFeatureArray = model.itemFactors.select($"id".as("itemId"), $"features".as("itemFeatures"))
  .where($"itemId" === 318).flatMap(row => row.getSeq[Float](1)).map(_.toDouble).collect()

// UserId 1
val aUserFeatureArray = model.userFactors.select($"id".as("userId"), $"features".as("userFeatures"))
  .where($"userId" === 1).flatMap(row => row.getSeq[Float](1)).map(_.toDouble).collect()

// Create JBlas DoubleMatrix
val aUserFeatureVector = new DoubleMatrix(aUserFeatureArray)
val anItemFeatureVector = new DoubleMatrix(anItemFeatureArray)

// Take dot product of the User x Item vectors
// This should equal the confidence value in the offline-generated matrix
val confidence = aUserFeatureVector.dot(anItemFeatureVector)
